function twoSum(nums, target) {
   const array = nums.concat();
   let low = 0;
   let high = array.length - 1;

   while (low <= high) {
      const mid = Math.floor((low + high) / 2);
      if (target === array[mid]) {
         return [array[low], array[mid]];
      } else if (target < array[mid]) {
         low = mid + 1;
      } else {
         high = mid - 1;
      }
   }
}
